INSERT INTO S_evenement.tblEvenement([nom],[dateDebut],[dateFin],[affiche],[url],[description],[dateSupprime]) VALUES('Festi-rire 2010','2010/01/02','2010/11/02', CONVERT(varbinary(max),''),'https://jimdo.com/pulvinar/sed/nisl/nunc/rhoncus.json?dictumst=enim&morbi=sit&vestibulum=amet&velit=nunc&id=viverra&pretium=dapibus&iaculis=nulla&diam=suscipit&erat=ligula&fermentum=in&justo=lacus&nec=curabitur&condimentum=at&neque=ipsum&sapien=ac&placerat=tellus&ante=semper&nulla=interdum&justo=mauris&aliquam=ullamcorper&quis=purus&turpis=sit&eget=amet&elit=nulla&sodales=quisque&scelerisque=arcu&mauris=libero','Au-delà des questions géographiques, d’autres rivalités se situent dans le quotidien. Les célibataires VS les couples, qui est le plus heureux le soir de la St-Valentin? Les jeunes VS les vieux, l’énergie ou l’expérience?  ',NULL);
INSERT INTO S_evenement.tblEvenement([nom],[dateDebut],[dateFin],[affiche],[url],[description],[dateSupprime]) VALUES('Festi-rire 2011','2011/01/02','2011/11/02',CONVERT(varbinary(max),''),'http://disqus.com/neque/libero/convallis/eget/eleifend.jsp?consequat=proin&in=risus&consequat=praesent&ut=lectus&nulla=vestibulum&sed=quam&accumsan=sapien&felis=varius&ut=ut&at=blandit&dolor=non&quis=interdum&odio=in&consequat=ante&varius=vestibulum&integer=ante&ac=ipsum&leo=primis&pellentesque=in&ultrices=faucibus&mattis=orci&odio=luctus&donec=et&vitae=ultrices&nisi=posuere&nam=cubilia&ultrices=curae&libero=duis&non=faucibus&mattis=accumsan&pulvinar=odio&nulla=curabitur&pede=convallis&ullamcorper=duis&augue=consequat&a=dui&suscipit=nec&nulla=nisi&elit=volutpat&ac=eleifend&nulla=donec&sed=ut&vel=dolor&enim=morbi&sit=vel&amet=lectus&nunc=in&viverra=quam&dapibus=fringilla&nulla=rhoncus&suscipit=mauris&ligula=enim&in=leo&lacus=rhoncus&curabitur=sed&at=vestibulum&ipsum=sit&ac=amet&tellus=cursus&semper=id&interdum=turpis&mauris=integer&ullamcorper=aliquet&purus=massa&sit=id&amet=lobortis&nulla=convallis&quisque=tortor&arcu=risus&libero=dapibus&rutrum=augue&ac=vel&lobortis=accumsan&vel=tellus','Les conflits peuvent également surgir de traits de personnalités comme les esprits terre-à-terre VS les esprits éclatés, tordus, f**kés! Le pantalon corduroy beige ou le jeans rouge vif? Ou encore les personnalités cérébrales ou plutôt impulsives. On s’imagine mal Denise Bombardier flipper sa maison à grands coups de masse dans les murs! ',NULL);
INSERT INTO S_evenement.tblEvenement([nom],[dateDebut],[dateFin],[affiche],[url],[description],[dateSupprime]) VALUES('Festi-rire 2012','2012/01/02','2012/11/02',CONVERT(varbinary(max),''),'http://e-recht24.de/non/interdum/in/ante/vestibulum.aspx?odio=molestie&odio=lorem&elementum=quisque&eu=ut&interdum=erat&eu=curabitur&tincidunt=gravida&in=nisi&leo=at&maecenas=nibh&pulvinar=in&lobortis=hac&est=habitasse&phasellus=platea&sit=dictumst&amet=aliquam&erat=augue&nulla=quam&tempus=sollicitudin&vivamus=vitae&in=consectetuer&felis=eget&eu=rutrum&sapien=at&cursus=lorem&vestibulum=integer&proin=tincidunt&eu=ante&mi=vel&nulla=ipsum&ac=praesent&enim=blandit&in=lacinia&tempor=erat&turpis=vestibulum&nec=sed&euismod=magna&scelerisque=at&quam=nunc&turpis=commodo&adipiscing=placerat&lorem=praesent&vitae=blandit&mattis=nam&nibh=nulla&ligula=integer&nec=pede&sem=justo&duis=lacinia&aliquam=eget&convallis=tincidunt&nunc=eget&proin=tempus&at=vel&turpis=pede&a=morbi&pede=porttitor&posuere=lorem&nonummy=id&integer=ligula&non=suspendisse&velit=ornare&donec=consequat&diam=lectus&neque=in&vestibulum=est&eget=risus&vulputate=auctor&ut=sed&ultrices=tristique&vel=in&augue=tempus&vestibulum=sit&ante=amet&ipsum=sem&primis=fusce&in=consequat','Cette année, le Galas Festi rire s’attaquent aux grandes rivalités des Québécois. Évidemment, qui dit rivalités québécoises pense immédiatement à Canadiens VS Nordiques. Non, pas de galas sur ce sujet, le but d’Alain Côté n’était pas bon, fin du débat! Mais cet esprit compétitif a même traversé l’Atlantique avec nos « chers » cousins français! Le Québec vs la France est bel et bien existant. Anne Dorval peut bien avoir pété un plomb sur un plateau de télé français!! Ils nous cherchent!  ',NULL);
INSERT INTO S_evenement.tblEvenement([nom],[dateDebut],[dateFin],[affiche],[url],[description],[dateSupprime]) VALUES('Festi-rire 2013','2013/01/02','2013/11/02',CONVERT(varbinary(max),''),'https://alibaba.com/platea/dictumst/maecenas/ut/massa.html?sed=volutpat&magna=convallis&at=morbi&nunc=odio&commodo=odio&placerat=elementum&praesent=eu&blandit=interdum&nam=eu&nulla=tincidunt&integer=in&pede=leo&justo=maecenas&lacinia=pulvinar&eget=lobortis&tincidunt=est&eget=phasellus&tempus=sit&vel=amet&pede=erat&morbi=nulla&porttitor=tempus&lorem=vivamus&id=in&ligula=felis&suspendisse=eu&ornare=sapien&consequat=cursus&lectus=vestibulum&in=proin&est=eu&risus=mi&auctor=nulla&sed=ac&tristique=enim&in=in&tempus=tempor&sit=turpis&amet=nec&sem=euismod&fusce=scelerisque&consequat=quam&nulla=turpis&nisl=adipiscing&nunc=lorem&nisl=vitae&duis=mattis&bibendum=nibh&felis=ligula&sed=nec&interdum=sem&venenatis=duis&turpis=aliquam&enim=convallis&blandit=nunc&mi=proin&in=at&porttitor=turpis&pede=a&justo=pede&eu=posuere&massa=nonummy&donec=integer&dapibus=non&duis=velit&at=donec&velit=diam&eu=neque&est=vestibulum&congue=eget&elementum=vulputate&in=ut&hac=ultrices&habitasse=vel&platea=augue&dictumst=vestibulum&morbi=ante&vestibulum=ipsum&velit=primis&id=in&pretium=faucibus&iaculis=orci&diam=luctus&erat=et&fermentum=ultrices&justo=posuere&nec=cubilia&condimentum=curae&neque=donec&sapien=pharetra&placerat=magna&ante=vestibulum&nulla=aliquet&justo=ultrices&aliquam=erat&quis=tortor&turpis=sollicitudin','L''événement met en valeur le travail des artistes du secteur de l''humour en les récompensant pour leurs œuvres. Il a également pour but de faire la promotion de l''industrie humoristique, en plus de faire connaître au public les humoristes émergents, mais également les auteurs et les metteurs en scène.',NULL);
INSERT INTO S_evenement.tblEvenement([nom],[dateDebut],[dateFin],[affiche],[url],[description],[dateSupprime]) VALUES('Festi-rire 2014','2014/01/02','2014/11/02',CONVERT(varbinary(max),''),'https://icq.com/turpis.html?nam=accumsan&dui=odio&proin=curabitur&leo=convallis&odio=duis&porttitor=consequat&id=dui&consequat=nec&in=nisi&consequat=volutpat&ut=eleifend&nulla=donec&sed=ut&accumsan=dolor&felis=morbi&ut=vel&at=lectus&dolor=in&quis=quam&odio=fringilla&consequat=rhoncus&varius=mauris&integer=enim&ac=leo&leo=rhoncus&pellentesque=sed&ultrices=vestibulum','On a tellement ri l’an dernier qu’on le ramène pour une deuxième édition! Sous la surveillance d’Eddy King à l’animation, le Gala humour de la rentrée 2016 mettra en vedette Didier Lambert, Jay Du Temple, Étienne Dano, Charles Deschamps, Mélanie Ghanimé ainsi qu’un invité surprise. Le spectacle parfait pour bien amorcer la rentrée et commencer son expérience OUMF en beauté!',NULL);
