INSERT INTO S_evenement.tblEvenement([nom],[dateDebut],[dateFin],[affiche],[url],[description],[dateSupprime]) VALUES('Festi-rire 2017','2017/01/02','2017/11/02',CONVERT(varbinary(max),''),NULL,'La 15ème édition du Festival aura lieu cette année du 2 janvier au 2 novembre 2017. 17 spectacle seront à l’affiche dans le département de l’Eure- et-Loir. Les villes partenaires du festival sont cette année : Chartres, Mainvilliers, Luisant, Lucé, Gasville-Oisème, Cloyes-sur-le- Loir, Auneau, Epernon, Dreux, Anet et Thivars.',NULL);
