INSERT INTO S_evenement.tblCommanditaire([nomCommanditaire],[nomContact],[logo],[url],[textePresentation],[courrielContact],[numTel],[extension],[dateSupprime]) VALUES('Diamond Athletic','Blake Ramirez',CONVERT(varbinary(max),''),'https://www.diamondathletic.com/','Diamond Athletic est très heureuse d''avoir conclu avec l''ACTS une entente à long terme en tant que principal commanditaire national. ','diamondAthletic@hotmail.com','6613729942','22345',NULL);
INSERT INTO S_evenement.tblCommanditaire([nomCommanditaire],[nomContact],[logo],[url],[textePresentation],[courrielContact],[numTel],[extension],[dateSupprime]) VALUES('KineMedics','Shelly Dale',CONVERT(varbinary(max),''),'http://www.kinemedics.com/','KineMedics est un fier commanditaire de l''ACTS et le commanditaire principal du Mois de la thérapie du sport en juin de chaque année.','KineMedics@hotmail.com','7712329869','10525',NULL);
INSERT INTO S_evenement.tblCommanditaire([nomCommanditaire],[nomContact],[logo],[url],[textePresentation],[courrielContact],[numTel],[extension],[dateSupprime]) VALUES('DJO Global','Jelani Donovan',CONVERT(varbinary(max),''),'https://www.djoglobal.com/','DJO Global est un leader dans le développement à l''échelle mondiale, un manufacturier et un distributeur de matériel médical et de services de grande qualité; l''entreprise offre des solutions pour la santé du musculo-squelettique, la santé vasculaire et la gestion de la douleur. ','djoglobal@hotmail.ca','8454369174','50589',NULL);
INSERT INTO S_evenement.tblCommanditaire([nomCommanditaire],[nomContact],[logo],[url],[textePresentation],[courrielContact],[numTel],[extension],[dateSupprime]) VALUES('POP','Charlotte Burke',CONVERT(varbinary(max),''),'http://www.poportho.com/','Fondée en 1996 par son président  Martin Paul Onrot, l''entreprise «Professional Orthopedic Products (POP)» s''est efforcée de fournir aux Canadiens des produits orthopédiques et de médecine du sport de la meilleure qualité et provenant de partout dans le monde','pop@hotmail.com','7743522111','20314',NULL);
INSERT INTO S_evenement.tblCommanditaire([nomCommanditaire],[nomContact],[logo],[url],[textePresentation],[courrielContact],[numTel],[extension],[dateSupprime]) VALUES('Trainers Choice','Malachi Bowen',CONVERT(varbinary(max),''),'http://www.trainerschoice.ca/','En tant qu''un des principaux fournisseurs de produits de médecine du sport,«Trainers Choice» demeure déterminé à offrir un service à la clientèle exceptionnel, des produits de qualité et des prix compétitifs.','trainerschoice@hotmail.ca','7744825879','77746',NULL);
INSERT INTO S_evenement.tblCommanditaire([nomCommanditaire],[nomContact],[logo],[url],[textePresentation],[courrielContact],[numTel],[extension],[dateSupprime]) VALUES('Vancouver Canucks Alumni','Quin Ochoa',CONVERT(varbinary(max),''),'http://canucks.nhl.com/','La «Vancouver Canucks Alumni» est formée d''anciens joueurs de hockey, de coachs et d''administrateurs; elle a plus de 100 membres et  d''associés dans le grand Vancouver. ','VCAlumni@hotmail.com','2671957243','35705',NULL);
INSERT INTO S_evenement.tblCommanditaire([nomCommanditaire],[nomContact],[logo],[url],[textePresentation],[courrielContact],[numTel],[extension],[dateSupprime]) VALUES('Human Kinetics','Tatiana Mcfadden',CONVERT(varbinary(max),''),'http://www.humankinetics.com/cata-store?associate=1042&virtual=1','«Human Kinetics» est l''éditeur principal de ressources en sport et en condition physique, produisant des manuels et leurs annexes, des livres pour les consommateurs, des logiciels, des DVD, des revues et des cours d''éducation en ligne. ','HumanKinetics@hotmail.com','7221856923','1612',NULL);
