INSERT INTO S_evenement.tblCommanditaire([nomCommanditaire],[nomContact],[logo],[url],[textePresentation],[courrielContact],[numTel],[extension],[dateSupprime]) VALUES('Medelco','Bert Rogers',CONVERT(varbinary(max),''),'http://www.medelco.ca/','L''entreprise Medelco est fière d''être le commanditaire officiel des modalités de l''Examen national d''agrément de l''ACTS. Longtemps connus comme les spécialistes de tous les secteurs des modalités et des équipements thérapeutiques, Medelco exploite une ligne complète de fournitures et de bandages pour la thérapie du sport, et cela, à des prix compétitifs. ','Medelco@hotmail.com','2711531856','78391',NULL);
